import React from 'react';

class TypingGame extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      score: 0
    };
  }


  render() {
    return (
      <div>
        <div>Populate</div>
        <div>Score: {this.state.score}</div>
      </div>
    );
  }

}

export default TypingGame;
